        switch (i) {
        case 0: p = (uint8 *) ikey; break;
        case 1: p = (uint8 *) itype; break;
        default: return SOC_E_INTERNAL;
        }
        sal_memset(p, 0, width <= 32 ? (int) sizeof(int) : (width + 7) / 8);
        ibe = be && width <= 32;
