/* entry index checker for oamcountegr */
int soc_sbx_g2p3_oamcountegr_index_check(int unit,
                int *vindex,
                int ipei)
{
    int i, r, pos, width, fmt, ibe, pibe;
    uint8 *p, *p0;
    soc_sbx_g2p3_state_t *fe =
        (soc_sbx_g2p3_state_t *) SOC_SBX_CONTROL(unit)->drv;
    soc_sbx_g2p3_table_manager_t *tm = fe->tableinfo;
    soc_sbx_g2p3_entry_desc_t *ed =
        &tm->entries[SOC_SBX_G2P3_OAMCOUNTEGR_ID];
    soc_sbx_g2p3_index_desc_t *id;
    int psize =
        (ed->indexeswidth + sizeof(int) * 8 - 1) / (sizeof(int) * 8)
        * sizeof(int);
    int be = tm->behost;
    int pkbe = be;

    sal_memset(vindex, 0, psize);

    p0 = ((uint8 *) vindex) + (pkbe ? psize - 1 : 0);

    for (i = 0; i < ed->nindexes; i++) {
        id = &ed->indexes[i];
        width = id->width;
        pos = id->pos;
        fmt = id->format;
        switch (i) {
        case 0: p = (uint8 *) &ipei; break;
        default: return SOC_E_INTERNAL;
        }
        r = ed->indexes[i].range;
        if (0 < r && r <= *(int *) p) {
            soc_sbx_g2p3_errsym = ed->indexes[i].name;
            return SOC_E_PARAM;
        }
        ibe = be && width <= 32;
        if (ibe) {
            p += sizeof(int) - 1;
        }
	pibe = 
	  (fmt == SOC_SBX_G2P3_BE_INTEGER_FORMAT
	   || (fmt == SOC_SBX_G2P3_NATIVE_INTEGER_FORMAT && be));
        soc_sbx_g2p3_insert(p0,
               pkbe, pos, width, p, ibe, pibe != pkbe);
    }

    return SOC_E_NONE;
}

/* entry argument checker for oamcountegr */
int soc_sbx_g2p3_oamcountegr_entry_check(int unit,
                soc_sbx_g2p3_oamcountegr_t *e)
{
    int i, r;
    uint32 ev = 0;
    soc_sbx_g2p3_state_t *fe =
        (soc_sbx_g2p3_state_t *) SOC_SBX_CONTROL(unit)->drv;
    soc_sbx_g2p3_table_manager_t *tm = fe->tableinfo;
    soc_sbx_g2p3_entry_desc_t *ed =
        &tm->entries[SOC_SBX_G2P3_OAMCOUNTEGR_ID];

    for (i = 0; i < ed->nfields; i++) {
        switch (i) {
        case 0: ev = e->lpindex; break;
        }
        r = ed->fields[i].range;
        if (0 < r && ((uint32) r) <= ev) {
            soc_sbx_g2p3_errsym = ed->fields[i].name;
            return SOC_E_PARAM;
        }
    }

    return SOC_E_NONE;
}

/* oamcountegr table size get */
int soc_sbx_g2p3_oamcountegr_entry_table_size_get(int unit,
                int *tsize,
                int ipei)
{
    int i, r, bits = 0, ecount = 0, v = 0;
    soc_sbx_g2p3_state_t *fe =
        (soc_sbx_g2p3_state_t *) SOC_SBX_CONTROL(unit)->drv;
    soc_sbx_g2p3_table_manager_t *tm = fe->tableinfo;
    soc_sbx_g2p3_entry_desc_t *ed =
        &tm->entries[SOC_SBX_G2P3_OAMCOUNTEGR_ID];
    soc_sbx_g2p3_entry_bank_t *eb = &ed->banks[0];
    int ebwidth = eb->width;
    soc_sbx_g2p3_table_desc_t *td = &tm->tables[ed->table];
    soc_sbx_g2p3_table_bank_t *tb = &td->banks[eb->tablebank];
    int tbwidth = tb->width;

    for (i = ed->nindexes - 1; 0 <= i ; i--) {
        switch (i) {
        case 0: v = ipei; break;
        }
        bits += ed->indexes[i].width;
        r = 1 << ed->indexes[i].width;
        if (v < 1 || r < v
            || (ecount && r != v)
            || bits > 32) {
            soc_sbx_g2p3_errsym = ed->indexes[i].name;
            return SOC_E_PARAM;
        }
        if (!ecount && (v > 1 || i == 0)) {
            ecount = v << ed->indexes[i].pos;
        }
    }

    *tsize = (ecount * ebwidth + (tbwidth - 1)) / tbwidth;
    return SOC_E_NONE;
}

/* entry set accessor implementation for oamcountegr */
int soc_sbx_g2p3_oamcountegr_set(int unit,
                int ipei,
                soc_sbx_g2p3_oamcountegr_t *e)
{
    int s, key[32];
    soc_sbx_g2p3_state_t *fe =
        (soc_sbx_g2p3_state_t *) SOC_SBX_CONTROL(unit)->drv;
    soc_sbx_g2p3_table_manager_t *tm = fe->tableinfo;
    soc_sbx_g2p3_entry_desc_t *ed =
        &tm->entries[SOC_SBX_G2P3_OAMCOUNTEGR_ID];

    s = soc_sbx_g2p3_oamcountegr_index_check(unit, key,
                ipei);
    if (s) {
        return s;
    }

    s = soc_sbx_g2p3_oamcountegr_entry_check(unit, e);

    if (s) {
        return s;
    }
    sal_mutex_take(tm->dmabufmutex, sal_mutex_FOREVER);

    s = soc_sbx_g2p3_oamcountegr_pack(unit, 
                  e, tm->entrydmabuf, ed->epsize);
    if (!s) {
        s = soc_sbx_g2p3_entry_read_write(unit, 0, key[0], ed);
    }
    sal_mutex_give(tm->dmabufmutex);

    return s;
}

/* entry get accessor implementation for oamcountegr */
int soc_sbx_g2p3_oamcountegr_get(int unit,
                int ipei,
                soc_sbx_g2p3_oamcountegr_t *e)
{
    int s, key[32];
    soc_sbx_g2p3_state_t *fe =
        (soc_sbx_g2p3_state_t *) SOC_SBX_CONTROL(unit)->drv;
    soc_sbx_g2p3_table_manager_t *tm = fe->tableinfo;
    soc_sbx_g2p3_entry_desc_t *ed =
        &tm->entries[SOC_SBX_G2P3_OAMCOUNTEGR_ID];

    s = soc_sbx_g2p3_oamcountegr_index_check(unit, key,
                ipei);
    if (s) {
        return s;
    }
    sal_mutex_take(tm->dmabufmutex, sal_mutex_FOREVER);
    if (!s) {
        s = soc_sbx_g2p3_entry_read_write(unit, 1, key[0], ed);
    }
    if (!s) {
        s = soc_sbx_g2p3_oamcountegr_unpack(unit,
                        e, tm->entrydmabuf, ed->epsize);
    }
    sal_mutex_give(tm->dmabufmutex);

    return s;
}

