/* entry print accessor implementation for ach_channel_type */
void soc_sbx_g2p3_ach_channel_type_print(int unit, 
    soc_sbx_g2p3_ach_channel_type_t *e)
{
    int i, col, width, iffok, w = 0;
    uint32 v = 0;
    soc_sbx_g2p3_field_desc_t *fd;
    soc_sbx_g2p3_state_t *fe =
        (soc_sbx_g2p3_state_t *) SOC_SBX_CONTROL(unit)->drv;
    soc_sbx_g2p3_table_manager_t *tm = fe->tableinfo;
    soc_sbx_g2p3_entry_desc_t *ed =
        &tm->entries[SOC_SBX_G2P3_ACH_CHANNEL_TYPE_ID];

    LOG_CLI((BSL_META_U(unit,
                        "  ")));
    col=2;
    for(i = 0; i < ed->nfields; i++) {
        fd = &ed->fields[i];
        width = fd->width;
        iffok = 1;
        switch (i) {
        case 0: v = e->rawbfd; w = 6;  break;
        case 1: v = e->ipbfd; w = 5;  break;
        case 2: v = e->ping; w = 4;  break;
        case 3: v = e->mcc; w = 3;  break;
        case 4: v = e->scc; w = 3;  break;
        case 5: v = e->psc; w = 3;  break;
        case 6: v = e->loop; w = 4;  break;
        case 7: v = e->y1731; w = 5;  break;
        }

        if (iffok) {
            if (col + w + 1 + 2 + (width + 3) / 4 > 72) {
                LOG_CLI((BSL_META_U(unit,
                                    "\n  ")));
                col=2;
            }
            LOG_CLI((BSL_META_U(unit,
                                "%s="), fd->name));
            col += w + 1;
            w = soc_sbx_g2p3_print(fd->range, v);
            col += w;
            LOG_CLI((BSL_META_U(unit,
                                " ")));
            col++;
        }
    }
    LOG_CLI((BSL_META_U(unit,
                        "\n")));
}

