/* entry print accessor implementation for oamcountegr */
void soc_sbx_g2p3_oamcountegr_print(int unit, 
    soc_sbx_g2p3_oamcountegr_t *e)
{
    int i, col, width, iffok, w = 0;
    uint32 v = 0;
    soc_sbx_g2p3_field_desc_t *fd;
    soc_sbx_g2p3_state_t *fe =
        (soc_sbx_g2p3_state_t *) SOC_SBX_CONTROL(unit)->drv;
    soc_sbx_g2p3_table_manager_t *tm = fe->tableinfo;
    soc_sbx_g2p3_entry_desc_t *ed =
        &tm->entries[SOC_SBX_G2P3_OAMCOUNTEGR_ID];

    LOG_CLI((BSL_META_U(unit,
                        "  ")));
    col=2;
    for(i = 0; i < ed->nfields; i++) {
        fd = &ed->fields[i];
        width = fd->width;
        iffok = 1;
        switch (i) {
        case 0: v = e->lpindex; w = 7;  break;
        }

        if (iffok) {
            if (col + w + 1 + 2 + (width + 3) / 4 > 72) {
                LOG_CLI((BSL_META_U(unit,
                                    "\n  ")));
                col=2;
            }
            LOG_CLI((BSL_META_U(unit,
                                "%s="), fd->name));
            col += w + 1;
            w = soc_sbx_g2p3_print(fd->range, v);
            col += w;
            LOG_CLI((BSL_META_U(unit,
                                " ")));
            col++;
        }
    }
    LOG_CLI((BSL_META_U(unit,
                        "\n")));
}

/* entry diag shell print implementation for oamcountegr */
int soc_sbx_g2p3_oamcountegr_shell_print(int unit,
             int argc, char **argv);
int
soc_sbx_g2p3_oamcountegr_shell_print(int unit,
         int argc, char **argv)
{
    soc_sbx_g2p3_oamcountegr_t e0;
    soc_sbx_g2p3_oamcountegr_t *e = &e0;
    int rv;
    soc_sbx_g2p3_state_t *fe =
        (soc_sbx_g2p3_state_t *) SOC_SBX_CONTROL(unit)->drv;
    soc_sbx_g2p3_table_manager_t *tm = fe->tableinfo;
    soc_sbx_g2p3_entry_desc_t *ed =
        &tm->entries[SOC_SBX_G2P3_OAMCOUNTEGR_ID];
    int ipei;
    void *indexpointers[1];

    indexpointers[0] = &ipei;
    {
        rv = soc_sbx_g2p3_indexes_read(indexpointers, ed, argc, argv);
        if (rv < 0) {
            return SOC_E_PARAM;
        }
        if (rv != argc) {
            LOG_CLI((BSL_META_U(unit,
                                "'%s' is not a valid index for %s\n"),
                     argv[rv], ed->name));
            return SOC_E_PARAM;
        }
    }

    do {
        rv = soc_sbx_g2p3_oamcountegr_get(unit,
                ipei,
                e);

        if (rv) {
            LOG_CLI((BSL_META_U(unit,
                                "get of %s failed\n"), ed->name));
            return rv;
        }

        soc_sbx_g2p3_indexes_print(indexpointers, ed);
        soc_sbx_g2p3_oamcountegr_print(unit, e);
    } while (0);

    return SOC_E_NONE;
}

